import './Login.css'; // We will create this CSS file next

function LoginScreen() {
  return (
    <div className="login-screen">
      <img src="./superpowerdm/src/Assets/blueFullLogo.png" alt="Your Image Description" className="centered-image" />
      <h2>Helping Creators Maximize Follower-Engagement with AI</h2>
      <button className="login-button">Log In</button>
    </div>
  );
}

export default LoginScreen;
